	(25,'Nexus Management','<h3 class=\"emphasis\">MSP Uses Empirum as Cornerstone for PC Lifecycle Management Services</h3>\r<p>Nexus relies on matrix42’s Empirum Pro suite for software installation and desktop management anywhere in the world</p>\r<h4 class=\"emphasis\">Case study abstract</h4>\r<p>Nexus Management is a managed services provider (MSP) specializing in the provision of IT services delivered through the secure use of the Internet. From its world-class data center, Nexus remotely manages its customers’ IT assets in their corporate networks.</p>\r<p>Three years ago, Nexus chose matrix42’s Empirum Pro as the foundation for its PC Lifecycle Management Services, designed to extend the life of corporate investments by ensuring that desktops and laptops are kept properly updated with the latest software and patches. Empirum is used by Nexus to rollout and install new applications and operating systems, and to keep them upto-date. The latter is particularly important as companies struggle to keep up with the almost daily release of patches to protect against a growing number of viruses and other attacks. Using Empirum, Nexus handles this for its customers automatically.</p>\r<p>According to Roger Richardson, CEO of Nexus, Empirum enables Nexus to centrally manage a very large number of desktops with very few administrative staff. Empirum is used to provide services for nine corporate customers with a combined total of nearly 2,000 networked PCs.</p>\r<p>Empirum is also used by the MSP to automatically maintain a detailed inventory of all software and hardware on its customers’ corporate networks – essential for license management and to ensure standardization across the enterprise.</p>\r<p>Nexus U.S. offices are in Brunswick, Maine, with customers in the United States and Canada, as well as in the United Kingdom, Australia and the Far East.</p>','nexus-management-logo.png',NULL,NULL,'2012-07-26 14:04:32',0,0),
	(26,'BMW Switzerland','<h3 class=\"emphasis\">BMW Group Switzerland</h3>\n<p>From zero to sixty in record time. BMW Group Switzerland manages its clients at an unexpected tempo.</p>\n<h3 class=\"emphasis\">The Company</h3>\n<p>BMW Group Switzerland is a successful world-wide company that follows a future-oriented course with a clear premium brand strategy. The unmistakable design, intelligent power plants/engines and the use of the latest technologies and materials, lead to the driving pleasure of a BMW, BMW Motorbikes, and MINI. Innovative technology increases the pleasure of driving a BMW product and improves security. The trading organization of the BMW Group Switzerland is composed of a comprehensive network in all regions of Switzerland, which provides the best customer care and competent service.</p>\n<h3 class=\"emphasis\">The Challenge</h3>\n<p>Today’s administration of PCs, Notebooks and Servers has all IT departments facing organizational challenges. Not only managing the total number of existing systems, but also the management of the installed applications, updates, and of course, the data security is the main challenge of any IT organization. In this case, the PC Lifecycle Management is just one of the responsibilities of the IT department. This is why any additional tasks require innovative solutions. This is what happened to Lothar Zank, IT Manager of the BMW Group Switzerland. While initially being responsible for about 250 clients, after a reorganization of departments, an additional 100 PCs were added to his IT department’s portfolio. With the premise of not increasing the existing IT team, or the administration manner, this was an absolutely impossible task with his old solution.</p>\n<p>The procedure that was used for software distribution via images, had already reached its limit. The time cost for the administration of the existing system landscape, via the method of creating and distributing a basic image with operating system and some Microsoft Office applications, was no longer productive. Additionally, in the BMW departments, there are some additional applications, which could not be covered by this basic image.</p>\n<h3 class=\"emphasis\">The Solution</h3>\n<p>Lothar Zank took the initiative, and used the IT fair, Orbit-iEX, for probing the existing providers of IT Lifecycle Management solutions. Five vendors were identified, which were to prove their products in further tests. Two of the software products failed the initial tests, and thus, came down to a decision between Endpoint Management by matrix42, and two other international developers.</p>\n<p>After the tests, Lothar Zank specifies the following issues, which were decisive in the selection of Endpoint Management:</p>\n<ul class=\"list\">\n	<li><span class=\"bold emphasis\">Homogenous, simple use</span> in all product areas</li>\n	<li><span class=\"bold emphasis\">Duration of the implementation</span></li>\n	<li><span class=\"bold emphasis\">Flexibility of the OS installation,</span> due to the dynamic hardware detection and the existing driver database</li>\n	<li><span class=\"bold emphasis\">Flexibility of the packaging</span> for making all software distributable in a manner which is fair for the company and users</li>\n	<li><span class=\"bold emphasis\">Role concept</span> (not administering each PC on its own, but computer groups)</li>\n	<li><span class=\"bold emphasis\">Support</span> - With questions or situations where help is required, the matrix42 Support is always at our side</li>\n</ul>\n<h3 class=\"emphasis\">Competent Local Support</h3>\n<p>In parallel to the intensive test phase, the issue was to find a dependable service provider and partner for the Endpoint Management support. matrix42 is represented by several Endpoint Management Solution Partners in Switzerland. The choice was UPGREAT AG in Fehraltorf, near Zurich. As an innovative solution provider for the IT necessities of small and also larger companies, UP-GREAT develops targetoriented services for the infrastructure management, as well as for the service and system management. The central asset of the company is global thinking. UP-GREAT takes care of IT Strategy counseling, performing of server and storage consolidations, and automatic system migrations.</p>\n<h3 class=\"emphasis\">Amortization and Saving Effects</h3>\n<p>After only three months, Endpoint Management was installed and running at BMW. 350 PCs are now being managed via Drag&Drop with operating system, software and patches. 70% of the tasks previously performed manually are performed today by Endpoint Management automatically. Additionally, the inventory data of the networked systems are available to BMW at any time. Endpoint Management displays which software, including the version is installed on what hardware. Changes to a system are logged, and if desired, they are announced to an IT employee via alarm. The R.O.I. has proven itself quickly with Endpoint Management. Looking back, an administration without Endpoint Management is no longer an option, and the decision was brilliant.</p>\n<h3 class=\"emphasis\">Matrix42</h3>\n<p>is the developer of Endpoint Management software, one of the leading solutions for software and client management, as well as a provider of corresponding consulting and engineering solutions.</p>','bmw-logo.png','case-bmw-en.pdf','<iframe width=\"560\" height=\"315\" src=\"http://www.youtube.com/embed/ZDuxWGHA-Z4\" frameborder=\"0\" allowfullscreen></iframe>','2012-07-26 16:32:44',0,0);
